(29, 1, '2025-02-10 11:57:19', '2025-02-10 14:57:19', 'O <strong>EliteCommerce</strong> é um projeto inovador voltado para o desenvolvimento de lojas virtuais robustas, escaláveis e personalizadas. Com tecnologia de ponta, foco em experiência do usuário e integração eficiente com sistemas de pagamento e logística, a plataforma garante alta conversão e desempenho otimizado. Criado para atender desde pequenas empresas até grandes varejistas, o <strong>EliteCommerce</strong> oferece flexibilidade, segurança e um design sofisticado, elevando o padrão do comércio eletrônico.', 'EliteCommerce', 'O EliteCommerce é uma solução de e-commerce de alto padrão, desenvolvida para marcas que buscam performance, segurança e design sofisticado.', 'publish', 'closed', 'closed', '', 'elitecommerce', '', '', '2025-02-10 17:18:56', '2025-02-10 20:18:56', '', 0, 'http://olivasdigital/?post_type=projects&#038;p=29', 0, 'projects', '', 0),
(30, 1, '2025-02-10 16:58:24', '2025-02-10 19:58:24', 'A <b>BLANC*</b> é uma startup inglesa que desenvolveu uma plataforma para conectar marcas de moda e beleza a varejistas do mundo todo promovendo vendas em atacado. Nela, as marcas publicam suas coleções e os varejistas entram em contato para obter os produtos em atacado e revender aos seus clientes locais.\n\nInovador, o site da empresa recebe milhares de visitantes mensalmente e necessitava da implementação de melhorias constantes. Buscava montar equipe interna de desenvolvimento, mas sabia que havia necessidades multidisciplinares e que se contratasse um time grande os custos seriam altos e haveria ociosidade.', 'BLANC*', 'A BLANC* é uma startup inglesa que conecta marcas de moda e beleza a varejistas globais para vendas em atacado. Com um site de alto tráfego, buscava otimizar sua plataforma sem elevar custos com uma equipe interna extensa.', 'inherit', 'closed', 'closed', '', '29-autosave-v1', '', '', '2025-02-10 16:58:24', '2025-02-10 19:58:24', '', 29, 'http://olivasdigital/?p=30', 0, 'revision', '', 0),
