(35, 1, '2025-02-10 18:21:03', '2025-02-10 21:21:03', 'O <strong>PrimeLanding</strong> é uma solução completa para a criação de landing pages sofisticadas, focadas em alta performance e conversão. Com um design moderno e responsivo, a página é estruturada para atrair, engajar e converter visitantes de forma estratégica. Utilizando tecnologias avançadas, otimização de velocidade e UX aprimorada, o <strong>PrimeLanding</strong> garante uma experiência imersiva e eficiente, ideal para campanhas de marketing digital, lançamentos de produtos e captação de leads.', 'PrimeLanding', 'O PrimeLanding é uma landing page de alto impacto, desenvolvida para maximizar conversões com design premium, velocidade otimizada e experiência interativa.', 'publish', 'closed', 'closed', '', 'primelanding', '', '', '2025-02-10 18:21:03', '2025-02-10 21:21:03', '', 0, 'http://olivasdigital/?post_type=projects&#038;p=35', 0, 'projects', '', 0),
