(39, 1, '2025-02-10 18:27:56', '2025-02-10 21:27:56', '', 'f705a163805f7ce14ff011c3a76815a2', '', 'inherit', 'open', 'closed', '', 'f705a163805f7ce14ff011c3a76815a2', '', '', '2025-02-10 18:27:56', '2025-02-10 21:27:56', '', 37, 'http://olivasdigital/wp-content/uploads/2025/02/f705a163805f7ce14ff011c3a76815a2.png', 0, 'attachment', 'image/png', 0),
(40, 1, '2025-02-10 19:08:42', '2025-02-10 22:08:42', 'O <strong>EliteStore</strong> é uma plataforma de e-commerce robusta, criada para marcas que buscam desempenho, segurança e design sofisticado. Com navegação intuitiva, carregamento rápido e integração com múltiplos meios de pagamento e logística, o sistema garante uma experiência de compra fluida e confiável. Totalmente responsivo e otimizado para SEO, o <strong>EliteStore</strong> permite escalabilidade e personalização, tornando-se a escolha ideal para empresas que desejam expandir suas vendas online com eficiência e inovação.', 'EliteStore', 'O EliteStore é um e-commerce de alto padrão, desenvolvido para proporcionar uma experiência de compra intuitiva, segura e otimizada para conversões.', 'publish', 'closed', 'closed', '', 'elitestore', '', '', '2025-02-10 19:08:42', '2025-02-10 22:08:42', '', 0, 'http://olivasdigital/?post_type=projects&#038;p=40', 0, 'projects', '', 0),
