(42, 1, '2025-02-10 19:41:23', '2025-02-10 22:41:23', '<div class=\"row\">\r\n	<div class=\"col-12 col-md-6 col-lg-4\">\r\n		<div class=\"form-group\">\r\n			<label for=\"nome\">Nome</label>\r\n			[text* nome id:nome placeholder \"Digite seu nome\"]\r\n		</div>\r\n	</div>\r\n  <div class=\"col-12 col-md-6 col-lg-4\">\r\n    <div class=\"form-group\">\r\n      <label for=\"email\">E-mail</label>\r\n      [email* email id:email placeholder \"Digite o seu endereço de e-mail\"]\r\n    </div>\r\n  </div>\r\n	<div class=\"col-12 col-md-12 col-lg-4\">\r\n		<div class=\"form-group\">\r\n			<label for=\"telefone\">Telefone</label>\r\n			[text* telefone id:telefone class:phonebr placeholder \"Digite o telefone\"]\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12\">\r\n		<div class=\"form-group\">\r\n			<label for=\"mensagem\">Mensagem</label>\r\n			[textarea* mensagem id:mensagem placeholder \"Informe sua mensagem com mais detalhes sobre este contato.\"]\r\n		</div>\r\n	</div>\r\n	<div class=\"col-12\">\r\n		<div class=\"form-group submit\">\r\n			[submit class:button \"Enviar mensagem\"]\r\n		</div>\r\n	</div>\r\n</div>\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@olivasdigital>\n[_site_admin_email]\nFrom: [your-name] [your-email]\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis is a notification that a contact form was submitted on your website ([_site_title] [_site_url]).\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@olivasdigital>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis email is a receipt for your contact form submission on our website ([_site_title] [_site_url]) in which your email address was used. If that was not you, please ignore this message.\nReply-To: [_site_admin_email]\n\n\n\nMensagem enviada, agradecemos o seu contato!\nThere was an error trying to send your message. Please try again later.\nUm ou mais campos possuem um erro. Por favor, verifique e tente novamente.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nPor favor, preencha este campo.\nThis field has a too long input.\nThis field has a too short input.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe uploaded file is too large.\nThere was an error uploading the file.\nPlease enter a date in YYYY-MM-DD format.\nThis field has a too early date.\nThis field has a too late date.\nPlease enter a number.\nThis field has a too small number.\nThis field has a too large number.\nThe answer to the quiz is incorrect.\nPor favor, insira um e-mail válido.\nPlease enter a URL.\nPlease enter a telephone number.\ndemo_mode: on', 'Contato', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2025-02-13 11:05:08', '2025-02-13 14:05:08', '', 0, 'http://olivasdigital/?post_type=wpcf7_contact_form&#038;p=42', 0, 'wpcf7_contact_form', '', 0);

